import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Admin from './components/Admin';
import User from './components/User';
import ShowServices from './components/Services/ShowServices';

function App() {
  return (
    <div className="App">
      <div id = "margo">
        <label id = "margo_label">Margo Nails</label>
      </div>
      <div>
        <ShowServices/>
      </div>
      <BrowserRouter>
        <Routes>
          <Route extract path="/admin" element={<Admin />} />
          <Route extract path="/user" element={<User />} />
        </Routes>
      </BrowserRouter>
      <div id = "contacts"></div>
    </div>
  );
}

export default App;
